import{_ as c}from"./chunks/index.VAya1KE4.js";import{c as a,o as e,G as o,k as t}from"./chunks/framework.BFEalnvt.js";import"./chunks/theme.B1I7hsVa.js";import"./chunks/getArrayRandomItem.LhrzGfRF.js";const b=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"params":{"pkg":"朱鸢","idList":[1158,1109,996,997,950,916,840,801,759,680,634,317,65,378,73,316,318,150,758,493,485,80,371,158,227,379,179,147],"data":{"id":634,"name":"朱鸢","summary":"朱鸢","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/07/06/15559334/1c64debafd7d934f8361b36026426940_897366969958613262.png","avatar":{"m":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/30/76099754/3ff8a8d8347b80d5d274cde64915120b_5442649137803298501.png","pc":"https://act-upload.mihoyo.com/nap-obc-indep/2024/07/06/15559334/a5b9690b0854a2d307bfd4b68901e7d0_927064676233291440.png"},"attrs":[["稀有度","S"],["属性","以太"],["特性","强攻"],["阵营","刑侦特勤组"]],"destiny":[["LEVEL1快速装填","朱鸢发动[连携技]/[终结技]时，将获得[快速装填]效果；当朱鸢拥有[快速装填]效果时，耗尽所有[强化霰弹]后，将消耗[快速装填]效果，立刻获得6/9枚[强化霰弹]。朱鸢曾经参加过雅努斯区治安官能力比拼大赛，并凭借着魔术般的装填技巧拔得头筹。同事对此评价道：无他，惟手熟尔。"],["LEVEL2以太余烬","[压制模式]下，朱鸢的抗打断等级提升，受到伤害降低10%；消耗[强化霰弹]攻击命中敌人时，[普通攻击：请勿抵抗]与[冲刺攻击：火力压制]造成的以太伤害提升10%，最多叠加5层，持续5秒，每次开火最多获得一层效果，重复触发时刷新持续时间。朱鸢装配有治安局特制的以太子弹，一旦击中敌人，则会对其造成不可逆的侵蚀伤害。所以，朱鸢在开枪前会喊话让敌方乖乖投降、放弃抵抗，真的是为了对方的安全着想…"],["LEVEL3治安官特训","[普通攻击]、[闪避]、[支援技]、[特殊技]、[连携技]技能等级+2作为精英治安官，朱鸢接受的训练只有一个目的：全面提升空洞内各项作战能力，碾压一切不法之徒。"],["LEVEL4以太侵彻","朱鸢消耗[强化霰弹]攻击命中敌人时，[普通攻击：请勿抵抗]与[冲刺攻击：火力压制]无视目标25%以太伤害抗性。在交战的时候，空洞的匪帮们喜欢暗中计算对方还剩多少子弹；但他们绝对想不到，朱鸢配备的特制弹匣，能够利用周围的以太为自己持续供电…"],["LEVEL5特勤经验","[普通攻击]、[闪避]、[支援技]、[特殊技]、[连携技]技能等级+2老练的特勤组治安官，更能懂得审时度势，高效发挥作战能力。有时候甚至只需要一个充满震慑力的眼神，就能让敌人打消抵抗的念头。"],["LEVEL6扩容能源包-叁型","朱鸢累计消耗12枚[强化霰弹]时，将获得[以太余温]效果,并使下次发动的[强化特殊技]能量消耗降低30点；发动[强化特殊技]时，将消耗[以太余温]效果，额外发射总计4枚以太鹿弹，每枚额外发射的以太鹿弹将造成朱鸢220%攻击力的伤害。朱鸢会经常在意自身装备的剩余电量，在电量下降至红色区域时感到紧张，并刻意节省电量。直到治安局为其配备了超大容量持续续航的能源包，才彻底解决了这个烦恼。"]],"skill":[{"title":"普通攻击：不许动！","desc":"[突击模式]点按发动：交替使用体术、手枪和以太鹿弹，向前方进行至多五段的攻击，造成物理伤害和以太伤害；第四、第五段攻击命中敌人时，获得1枚[强化霰弹]，同一招式中最多获得1枚；招式发动期间，拖曳摇杆并点按，可以发动[冲刺攻击：火力奇袭]，向对应方向调整身位；[突击模式]下，长按时，将会切换攻击方式，进入[压制模式]。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/28d53ce432f877a7f55ced6165427c32_4571758937078688348.gif"},{"title":"普通攻击：请勿抵抗","desc":"[压制模式]长按发动：使用霰弹枪向前方进行至多三段的穿透射击，造成物理伤害；开火时若拥有[强化霰弹]，则会消耗1枚[强化霰弹]，造成大量以太伤害；招式发动期间，拖曳摇杆可以发动[冲刺攻击:火力压制]，向对应方向调整身位；[压制模式]下，松开时，将会切换攻击方式，回到[突击模式]。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/28ee6c4d350617b1aae82f8f81ae75d1_4006194828001909333.gif"},{"title":"闪避：迂回","desc":"点按发动：快速的冲刺闪避；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/9d649727c076a82bd56e6878a383cfdc_8538211806312500415.gif"},{"title":"冲刺攻击：火力奇袭","desc":"[突击模式]闪避时，点按发动：使用手枪进行射击，造成以太伤害。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/3b00905d5251e281d240ddb22c29c76e_5623086666488011009.gif"},{"title":"冲刺攻击：火力压制","desc":"[压制模式]在[普通攻击：请勿抵抗]发动期间，拖曳摇杆发动：使用霰弹枪进行穿透射击，造成物理伤害；开火时若拥有[强化霰弹]，则会消耗1枚[强化霰弹]，造成大量以太伤害。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/be6e33657faf0e98e743cd2d01680c1c_6402616090530364216.gif"},{"title":"闪避反击：火力震爆","desc":"触发[极限闪避]后，点按发动：使用以太鹿弹对前方敌人发动射击，造成以太伤害；招式发动时，获得1枚[强化霰弹]；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/10/10/82232455/ea0f859ecf1969b3a00e5195ae357fa5_5466817006041501520.gif"},{"title":"快速支援：掩护射击","desc":"当前操作中的角色被击飞时，点按发动：使用以太鹿弹对前方敌人发动射击，造成以太伤害；招式发动时，获得1枚[强化霰弹]；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/07/10/15559334/74a4f69017e602784094af7b60a8994c_2132054436151375617.gif"},{"title":"回避支援：警戒援护","desc":"前场角色即将被攻击时，点按发动：回避敌人的攻击，并触发[极限视域]；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/fe597c1a952b078bd662b8541b7cc2a7_5391537058722199463.gif"},{"title":"支援突击：自卫还击","desc":"发动[回避支援]后，点按发动：交替使用体术和霰弹枪进行攻击，造成物理伤害和以太伤害；招式发动时，获得3枚[强化霰弹]；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/6beeae5974d52cce0e7e21b67ebd0c2b_6573331756598889608.gif"},{"title":"特殊技：鹿弹射击","desc":"点按发动：使用以太鹿弹进行射击，造成以太伤害，连续点按，可以重复射击三次；招式发动期间抗打断等级提升。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/fd2c297ea92e2a5ca9c9299a4b1502c1_5892523616066332586.gif"},{"title":"强化特殊技：全弹连射","desc":"能量足够时，点按发动：使用以太鹿弹进行连续射击，造成大量以太伤害；招式发动时，获得3枚[强化霰弹]；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/2b49cd10ef0368a955f041afcc72a447_9196265066361207406.gif"},{"title":"连携技：歼灭模式","desc":"触发[连携技]时，选择对应角色发动：使用完全变形武器进行饱和攻击，发射直线激光和追踪导弹，造成大量以太伤害；招式发动时，获得3枚[强化霰弹]；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/c10c2fe54747e7adc7a87f914d9a5b4c_6374339932230148844.gif"},{"title":"终结技：歼灭模式MAX","desc":"喧响等级达到[极]时，点按发动：使用完全变形武器进行饱和攻击，发射直线激光和追踪导弹，造成大量以太伤害；招式发动时，获得3枚[强化霰弹]；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/8d8abcbb9dca6feeb9391529c80ff462_9103250665656267652.gif"},{"title":"核心技","desc":"核心被动：特种弹药朱鸢在[压制模式]下，消耗[强化霰弹]进行攻击时，招式造成的伤害提升20%，攻击处于失衡状态下的敌人时，该增益效果额外提升20%；进入战场时，朱鸢立刻获得6枚[强化霰弹]。（此处数据为初始数据）额外能力：武装协同队伍中存在[支援]角色或与自身阵营相同的角色时触发：朱鸢发动[强化特殊技]、[连携技]或[终结技]时，自身暴击率提升30%，持续10秒。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/07/10/15559334/184e6d5c2d56ccd3279f368b82784a9c_4123919096199355886.gif"}]},"favModalLocalKey":"vitepress_game_zzz_role_fav_modal","favLocalKey":"vitepress_game_zzz_role_fav"},"relativePath":"game/zzz/role/朱鸢.md","filePath":"game/zzz/role/[pkg].md"}'),d={name:"game/zzz/role/朱鸢.md"},_=Object.assign(d,{setup(i){return(p,n)=>(e(),a("div",null,[o(t(c))]))}});export{b as __pageData,_ as default};
